info.description:
bl. prob. orig. with flame-shape; liz midrib becomes more rounded for socket but with v. sl. crest rib, and expands at m. to oval - sl. convexity to the expansion; loop plates not part. regular, both with constriction in lower part;
variable stump of cg. fl - thin - along s. sides, totally removed at ops. & prob. at m.; some suggestions of hammer ripples on s. forging poss. created crest ribs also off-centre sl. rib on rev. face; small hole on rev. side below lp. - prob. cg. flaw, rounded edges
series of str. along bl. & midrib, others traverse on s. and midrib - could be onc.; other impressions look like vice grip marks and file ripple; lead like substance at main break - solder? virt. all m. seems broken - poss. all core. dam.; bl. es. core. dam., p flaked.

